"use strict";Object.defineProperty(exports,"__esModule",{value:!0}),exports.projects=exports.alienInvasion=exports.rockPaperScissors=exports.simpleWeight=exports.choreApp=exports.traderBot=exports.mapAndWeather=exports.mockEcommerce=void 0;var e=require("../../public/projectImages/*.png"),t=require("../../public/projectImages/*.jpg"),o=Object.assign(Object.assign({},e),t);exports.mockEcommerce={name:"Mock Ecommerce",description:"Statically generated ecommerce site, \n                generated from content on a headless CMS \n                (right now its a sporting goods store).",images:[{src:o["mock-ecommerce-desktop"],alt:"Desktop screenshot of mock emcommerce application"}],technologies:["React","Next.js","TypeScript","Styled-Components","SWR","Strapi","PostgreSQL"],difficulties:"Managing state and persistant storage. \n                When navigating between pages state is lost, such as number of items in the shopping cart. \n                A page needs to have the previous state to display components properly,\n                failing to do so can create unwanted effects such as flickering.  \n                <br>\n                I initially planned to use Redux to manage state, and use storage (localStorage/sessionStorage) \n                to save it, so that when a new page is loaded, the previous state in storage is used to initalize the Redux store. \n                It was very complicated creating the store from storage because the way Next.js \n                handles routing on a staic site is a mix bewteen client side  \n                Components connected to the store would often render with stale data, and it generally felt wrong.",solution:"I researched and found the SWR package, which is a set of React hooks meant for remote data fetching, that \n            are also useful for local mutations.  With the useSWR hook, components get a constant stream of data updates automatically, \n            and render based on the state of the fetch - 'loading', 'error', or 'data'.  \n            The useSWR hook takes any fetching function that accepts a key, so \n            I created my own to fetch pieces of state saved in storage.   \n            <br>\n            The wishlist is a good example of this in use.  \n            Multiple components across the app need the wishlist's state to properly render. \n            The heart icon on the top navigation bar is connected to the state of the wishlist.\n            and will change color if the user has products in the wishlist.\n            The product cards also have the same heart icon on them, and change color if the product is in the wishlist. \n            Tapping on a product card's heart will either add or remove that product from the wishlist, \n            and everything connected to the wishlist's state will update.\n            ",features:["Decoupled frontend architecture","Responsive layout","Persistant state","Static page generation"],githubLink:"https://github.com/sfhemstreet/mock-ecommerce",liveLink:"https://mock-ecommerce.now.sh/"},exports.mapAndWeather={name:"Map and Weather",description:"Responsive map and weather dashboard, used to get 5-day weather reports, \n                while visualizing wind, temperature, precipitation, and cloud data for any given coordinates over map.  \n                The expandable sidebar displays a selectable list of saved coordinates, which can be filtered by type of data point, and by name. \n                The dashboard currently features a list of my favorite camping and rock climbing areas.",images:[{src:o["map-and-weather-medium"],alt:"Screen shot of map and weather app with weather overlay"}],technologies:["Leaflet.js","React.js","TypeScript","OpenWeatherMap API"],difficulties:"Integrating Leaflet.js into React.\n                Note - this project can't be hosted live, as the weather API I am using costs money when put online.\n                Check it out on GitHub, you can download, install and run it locally.",solution:"Wrote a simple reusable component for rendering a leaflet map.",features:["Resposive layout","Multiple map settings","Weather imaging","Search and filter list of points of interest"],githubLink:"https://github.com/sfhemstreet/MapNWeather"},exports.traderBot={name:"Trader Bot",description:"Python program to help automate cryptocurrency trades. \n                It uses real-time bitcoin inflow/outflow data from Token Analyst's \n                websocket feed to trigger trades on the BitMEX exchange. \n                Connecting to both the Token Analyst and BitMEX websockets, \n                users can get real-time bitcoin inflows and outflows to/from \n                exchanges and their BitMEX feed to monitor position, \n                margin, order, wallet, execution and trade data.",images:[{src:o["traderbot-demo"],alt:"Screen shot of Trader Bot automated trades"}],technologies:["Python","Websockets","Asyncio"],difficulties:"Connecting to multiple websockets.  I had never programmed in Python before so I was unsure how to go about doing that.",solution:"I went with an single threaded event loop approach because it seemed the simplest.  At a high level the \n            program waits for data, and reacts when it arrives, so I used asyncio to create an event loop, \n             gave it tasks that yeild data, and told it to run forver. When a \n             task yeilds data from a websocket it calls a function that starts the trading process.",features:["Simple API","OOP architecture","Websockets","asyncio"],githubLink:"https://github.com/sfhemstreet/TraderBot"},exports.choreApp={name:"Chore App",description:"Chore is an application to help keep track of household chores.\n                Users can create private chore groups, invite their roommates \n                to join, and select what chores need to be done.  Group creators \n                can set restrictions on who can add new chores to the group, \n                and add/remove members at any time. Chores can be assigned \n                randomly or can be manually assigned, include notes in chores \n                to make sure they are done correctly and set dates for when \n                they must be done by. Group members are notified when they \n                receive new chores via email, and receive points for every chore completed.",images:[{src:o["chore-home"],alt:"Screen shot of chore app home page"}],technologies:["React","Redux","tachyons","PostgreSQL","Node.js","Express","Json Web Tokens","Knex","Bcyrpt","SendGrid"],difficulties:"Session problems when interacting with the backend on mobile devices. \n                I researched a lot before going with a session-cookie approach to track user sessions. \n                It worked well till the first deployment and testing on a real mobile device.",solution:"I quickly changed to a Json Web Token approach, which worked well.",features:["Single Page Application","User authenicatoin","Json Web Token"],githubLink:"https://github.com/sfhemstreet/chore-app",liveLink:"https://chore-app-frontend.herokuapp.com/"},exports.simpleWeight={name:"Simple Weight",description:"Simple app to track daily caloric intake and body weight. \n                View weight/calorie data on a chart, see information such \n                as how much weight is lost on average per week, and \n                average calorie intake is like on weekdays vs weekend.",images:[{src:o["simple-weight-small"],alt:"Screen shot of simple weight app in use"}],technologies:["Flutter","Dart","Provider","SQLite","Shared Preferences","charts_flutter"],difficulties:"Finding a good solution for state management.",solution:"I went with the one the folks at Google apparently like, Provider.\n            I used its multi-provider to 'provide' multiple streams of immutable data.",features:["Cross-platform mobile application","iOS themed components","Simple UI"],githubLink:"https://github.com/sfhemstreet/simple_weight"},exports.rockPaperScissors={name:"Rock Paper Scissors",description:"Rock, Paper, Scissors coding challenge from Frontend Mentor \n                (https://www.frontendmentor.io/challenges/rock-paper-scissors-game-pTgwgvgH),\n                with 2 game modes, classic Rock, Paper, Scissors or the bonus \n                Rock, Paper, Scissors, Lizard, Spock. I chose to add subtle animations \n                to make the game play feel more organic, and added an option to change game play modes. \n                You can [play it here](https://rock-paper-scissors.spencerhemstreet.now.sh/).",images:[{src:o["rock-paper-scissors-small"],alt:"Rock Paper Scissors game screen shot"}],technologies:["React","Next.js","TypeScript","Styled-Components"],difficulties:"Animating pieces between game play states.",solution:"Keep app layout simple, don't rerender game pieces once on screen.",features:["Clean UI","Followed design to the pixel"],githubLink:"https://github.com/sfhemstreet/rock_paper_scissors",liveLink:"https://rock-paper-scissors-six.now.sh/"},exports.alienInvasion={name:"Alien Invasion",description:"Save humanity from aliens by destroying them before they land. HTML5 canvas vanilla JS game.",images:[{src:o["alien-invasion-small"],alt:"Screen shot of Alien Invasion gameplay"}],technologies:["HTML5","Canvas","JavaScript"],difficulties:"Making the game hard, but not impossible.",solution:"Tweak level difficultly after testing. \n            Add easter egg magic blue box that replaces your ship's \n            rockets with a proton-7 laser temporaraly.",features:["Old school hard gameplay","60fps","Incredible graphics"],githubLink:"https://github.com/sfhemstreet/alien-invasion-js",liveLink:"https://sfhemstreet.github.io/alien-invasion-js/"},exports.projects=[exports.mockEcommerce,exports.mapAndWeather,exports.simpleWeight,exports.rockPaperScissors,exports.choreApp,exports.traderBot,exports.alienInvasion];
